style.css:
/* Dark Mode Styles */
body {
    background-color: #2d2d2d;
    color: #ffffff;
    font-family: 'Arial', sans-serif;
}
 
/* Header Styles */
header {
    background-color: #1a1a1a;
    color: #ffffff;
    padding: 10px;
}
 
/* Navigation Styles */
nav {
    background-color: #333333;
}
 
nav a {
    color: #ffffff;
    text-decoration: none;
    padding: 10px;
    transition: color 0.3s ease;
}
 
nav a:hover {
    color: #ffd700; /* Change to your preferred highlight color */
}
 
/* Content Styles */
main {
    padding: 20px;
}
 
/* Footer Styles */
footer {
    background-color: #1a1a1a;
    color: #ffffff;
    padding: 10px;
}
 
